  true,\n\t\"url\": null,\n\t\"notes\": \"Polylines representing the dikes, folds
  and cross sections for the Caldwell 7.5-minute quadrangle, North Carolinann<br /><br
  />Diabase dike - inferred - Diabase:  Black to greenish-black, fine- to medium-grained,
  dense, consists primarily of plagioclase, augite, and may contain olivine.  Occurs
  as dikes up to 100 ft wide.  Diabase typically occurs as spheriodally weathered
  boulders with a grayish-brown weathering rind.  Red station location indicates outcrop
  or boulders of diabase.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
